import Pagination from '@/components/Pagination/index';
export default {
  name: 'ReviewArrest',
  components: {
    Pagination: Pagination
  },
  data: function data() {
    return {
      anjianinfo: [],
      infoPushVisible: false,
      bianGenInfo: {
        czrymc: '',
        bgrq: '',
        optContent: ''
      },
      form: {
        leibie: '',
        time: ['', ''],
        name: ''
      },
      // tableData: [],
      listQuery: {
        page: 1,
        pageSize: 10,
        keyWord: ''
      },
      tableHeader: [{
        filed: 'objectName',
        title: '咨询人姓名',
        colorB: 'colorB',
        width: '200'
      }, {
        filed: 'phone',
        title: '手机号码'
      }, {
        filed: 'handleTime',
        title: '处理时间'
      }, {
        filed: 'optionValueName',
        title: '咨询类型'
      }],
      tableData: [],
      listLoading: false,
      total: 0
    };
  },
  created: function created() {// this.getTime()
  },
  mounted: function mounted() {
    var _this = this;

    // this.getList()
    this.listLoading = true;
    this.$api.getwlhuajie({
      visitorName: this.form.name,
      startTime: this.form.time[0],
      endTime: this.form.time[1],
      optionValue: this.form.leibie,
      pageNum: 1,
      pageSize: 10
    }).then(function (res) {
      console.log(res);

      if (res.code === 0) {
        if (res.data) {
          _this.tableData = res.data.pageList;
          _this.total = res.data.total;
          _this.listLoading = false;
        } else {
          _this.$message.warning('暂无数据哦');

          _this.listLoading = false;
          _this.tableData = [];
        }
      }
    }).catch(function (err) {
      console.log(err);
    });
  },
  methods: {
    handleFilter: function handleFilter() {
      var _this2 = this;

      this.listLoading = true;
      this.listQuery.page = 1;
      this.listQuery.pageSize = 10;
      this.$api.getwlhuajie({
        visitorName: this.form.name,
        startTime: this.form.time[0],
        endTime: this.form.time[1],
        optionValue: this.form.leibie,
        pageNum: 1,
        pageSize: 10
      }).then(function (res) {
        console.log(res);

        if (res.code === 0) {
          if (res.data) {
            _this2.tableData = res.data.pageList;
            _this2.total = res.data.total;
            _this2.listLoading = false;
          } else {
            _this2.$message.warning('暂无数据哦');

            _this2.listLoading = false;
            _this2.tableData = [];
          }
        }
      }).catch(function (err) {
        console.log(err);
      });
    },
    chongzhi: function chongzhi() {
      this.form.time = ['', ''];
      this.form.name = '';
      this.form.leibie = '';
    },
    handleClick: function handleClick(row) {
      this.$router.push({
        name: 'hjxq',
        params: {
          id: row.id
        }
      });
    },
    handleChange: function handleChange(row) {},
    handleDle: function handleDle(row) {},
    handleAdd: function handleAdd() {
      this.$router.push({
        name: 'tjdj'
      });
    },
    getList: function getList() {
      this.listLoading = false;
    },
    refresh: function refresh(val) {
      var _this3 = this;

      this.listLoading = true;
      this.$api.getwlhuajie({
        visitorName: this.form.name,
        startTime: this.form.time[0],
        endTime: this.form.time[1],
        optionValue: this.form.leibie,
        pageNum: val.page,
        pageSize: val.limit
      }).then(function (res) {
        console.log(res);

        if (res.code === 0) {
          if (res.data) {
            _this3.tableData = res.data.pageList;
            _this3.total = res.data.total;
            _this3.listLoading = false;
          } else {
            _this3.$message.warning('暂无数据哦');

            _this3.listLoading = false;
            _this3.tableData = [];
          }
        }
      }).catch(function (err) {
        console.log(err);
      });
    },
    getTime: function getTime() {
      var nowDate = new Date();
      var date = {
        year: nowDate.getFullYear(),
        month: nowDate.getMonth() + 1
      };
      var mouth = ''; // 月

      if (date.month < 10) {
        mouth = '0' + date.month;
      } else {
        mouth = date.month;
      } // 日
      // if (date.date < 10) {
      //     day = '0' + date.date
      // } else {
      //     day = date.date
      // }


      this.form.start = date.year - 1 + '-' + mouth;
      this.form.end = date.year + '-' + mouth;
    }
  }
